import React, { useState } from "react";
import Modal from "react-modal";
import "../styles/HeroSection.css";
import card from "./Images/Card.png";
import google from "./Images/google.png";
import twitch from "./Images/twitch.png";
import facebook from "./Images/Facebook.png";
import pinterest from "./Images/Pinterest.png";
import YT from "./Images/YT.png";

Modal.setAppElement("#root"); // Accessibility setup for modal

function HeroSection() {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [formData, setFormData] = useState({ name: "", email: "", phone: "" });
  const [submissions, setSubmissions] = useState([]);

  const openModal = () => setIsModalOpen(true);
  const closeModal = () => setIsModalOpen(false);

//   const handleInputChange = (e) => {
//     const { name, value } = e.target;
//     setFormData({ ...formData, [name]: value });
//   };

  const handleSubmit = (e) => {
    e.preventDefault();
    const timestamp = new Date().toLocaleString();
    setSubmissions([...submissions, { ...formData, timestamp }]);
    setFormData({ name: "", email: "", phone: "" });
    closeModal();
    alert("Thank you for your interest! Weâ€™ll get back to you soon.");
  };

  return (
    <div className="hero">
      <div className="upper">
        <div className="head">Simplify Your Life with Our Todo App</div>
        <div className="body">
          Stay organized and boost your productivity with our intuitive todo
          website. Experience a modern approach to task management that fits
          your lifestyle.
        </div>
        <div className="button">
          <button className="btn1" onClick={openModal}>
            Get Started
          </button>
          <button className="btn2">Learn More</button>
        </div>
      </div>
      <div className="lower">
        <div className="banner">
          <p className="para1">Organize. Achieve. Relax.</p>
          <p className="para2">
            Turn clutter into clarity, chaos into control, and dreams into done.
          </p>
          <div>
            <button className="btn5" onClick={openModal}>
              Get Started Today
            </button>
            <button className="btn6">Discover Features</button>
          </div>
        </div>
        <div className="bannerimg">
          <img src={card} alt="Card" />
        </div>
      </div>

      <div className="socialmedia">
        <img src={google} alt="Google" />
        <img src={facebook} alt="Facebook" />
        <img src={YT} alt="YouTube" />
        <img src={pinterest} alt="Pinterest" />
        <img src={twitch} alt="Twitch" />
      </div>

      {/* Modal Popup */}
      <Modal
        isOpen={isModalOpen}
        onRequestClose={closeModal}
        contentLabel="Task Form"
        className="modal"
        overlayClassName="overlay"
      >
        <h2>Start Organizing</h2>
        <form onSubmit={handleSubmit}>
          <label>
            Name:
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleInputChange}
              required
            />
          </label>
          <label>
            Email:
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleInputChange}
              required
            />
          </label>
          <label>
            Phone Number:
            <input
              type="tel"
              name="phone"
              value={formData.phone}
              onChange={handleInputChange}
              required
            />
          </label>
          <button type="submit">Submit</button>
        </form>
        <button onClick={closeModal}>Close</button>
      </Modal>

      {/* Submissions Table */}
      <div className="submissions">
        <h3>Submissions</h3>
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Phone</th>
              <th>Submission Time</th>
            </tr>
          </thead>
          <tbody>
            {submissions.map((submission, index) => (
              <tr key={index}>
                <td>{submission.name}</td>
                <td>{submission.email}</td>
                <td>{submission.phone}</td>
                <td>{submission.timestamp}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default HeroSection;
